import React, {FC} from "react"
import {Menu} from "@material-ui/core"


export const CustomFormikMenu = ({setFieldValue, value, ...props}) => {

    const handleOnchange = ({target}) => {
        setFieldValue(props.name, target.value)
    }

    return (
        <Menu
            open={props.open}
            {...props}
        >
            {props.children}
        </Menu>
    )
};
